def generate(array):
    a = array[0]
    b = array[1]

    x1 = a
    x2 = w * h - a - len(b)

    ps = [0 for i in range(x1)]
    for x in b:
        ps.append(1 if x != " " else 0)
    ps += [0 for i in range(x2)]
    return ps


def convert1(ps):
    ps1 = []
    for j in range(h):
        ps1.append(ps[w * j: w * (j + 1)])
    return ps1


def convert2(ps):
    ps1 = ""
    for j in range(h):
        for i in range(w):
            ps1 += "*" if ps[j][i] == 1 else " "
        ps1 += "\n"
    return ps1


